import { GoogleMap, LoadScript } from "@react-google-maps/api";

const containerStyle = {
  width: "400px",
  height: "400px",
};

const center = {
  lat: 35,
  lng: 140,
};

const MyComponent = () => {
  return(
    <LoadScript googleMapsApiKey = "AIzaSyDowSiBu0DPlPwxFtTx8UPYjncHMF817Us">
      <GoogleMap
        mapContainerStyle = {containerStyle}
        center = {center}
        zoom = {17}
      />
    </LoadScript>
  );
};

export default MyComponent;
